CREATE TABLE `pr_productos` (
  `id_producto` bigint(20) NOT NULL AUTO_INCREMENT,
  `codigo_barra` text,
  `id_empresa` bigint(20) NOT NULL,
  `id_articulo` bigint(20) NOT NULL,
  `id_grupo` bigint(20) NOT NULL,
  `id_subgrupo` bigint(20) NOT NULL,
  `id_tipo_presentacion` bigint(20) DEFAULT NULL,
  `id_tipo_medidas` bigint(20) DEFAULT NULL,
  `cod_fabricante` bigint(20) DEFAULT NULL,
  `descontinuado` char(2) DEFAULT NULL,
  `nombre_producto` varchar(999) DEFAULT NULL,
  `registro_sanitario_local` text,
  `registro_sanitario_extranjero` text,
  `receta` char(3) DEFAULT NULL,
  `estado` char(2) DEFAULT NULL,
  `usuario_creacion` varchar(20) DEFAULT NULL,
  `fecha_creacion` datetime DEFAULT NULL,
  `usuario_actualizacion` varchar(20) DEFAULT NULL,
  `fecha_actualizacion` datetime DEFAULT NULL,
  `unidad_empaque_compra` double DEFAULT NULL,
  `medida_empaque_compra` bigint(20) DEFAULT NULL,
  `cantidad_por_empaque_compra` double DEFAULT NULL,
  `medida_por_empaque_compra` bigint(20) DEFAULT NULL,
  `unidad_empaque_venta` double DEFAULT NULL,
  `medida_empaque_venta` bigint(20) DEFAULT NULL,
  `cantidad_por_empaque_venta` double DEFAULT NULL,
  `medida_por_empaque_venta` bigint(20) DEFAULT NULL,
  `id_proveedor` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id_producto`,`id_empresa`,`id_articulo`,`id_grupo`,`id_subgrupo`),
  KEY `fk_tipo_presentacion$2` (`id_tipo_presentacion`),
  KEY `fk_empresa$6` (`id_empresa`),
  KEY `fk_medida_product$1` (`id_articulo`,`id_grupo`,`id_subgrupo`,`id_tipo_presentacion`,`id_tipo_medidas`),
  KEY `fk_fabricant$3_idx` (`cod_fabricante`),
  KEY `medida_empaque_compra` (`medida_empaque_compra`),
  KEY `medida_por_empaque_compra` (`medida_por_empaque_compra`),
  KEY `medida_empaque_venta` (`medida_empaque_venta`),
  KEY `medida_por_empaque_venta` (`medida_por_empaque_venta`),
  KEY `id_proveedor` (`id_proveedor`),
  CONSTRAINT `fk_empresa$6` FOREIGN KEY (`id_empresa`) REFERENCES `se_empresa` (`id_empresa`),
  CONSTRAINT `fk_fabricant$3` FOREIGN KEY (`cod_fabricante`) REFERENCES `pr_fabricante` (`id_fabricante`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_medida_product$1` FOREIGN KEY (`id_articulo`, `id_grupo`, `id_subgrupo`, `id_tipo_presentacion`, `id_tipo_medidas`) REFERENCES `pr_medidas` (`id_articulo`, `id_grupo`, `id_subgrupo`, `id_tipo_presentacion`, `id_tipo_medidas`),
  CONSTRAINT `pr_productos_ibfk_1` FOREIGN KEY (`medida_empaque_compra`) REFERENCES `pr_empaque` (`id`),
  CONSTRAINT `pr_productos_ibfk_2` FOREIGN KEY (`medida_por_empaque_compra`) REFERENCES `pr_empaque` (`id`),
  CONSTRAINT `pr_productos_ibfk_3` FOREIGN KEY (`medida_empaque_venta`) REFERENCES `pr_empaque` (`id`),
  CONSTRAINT `pr_productos_ibfk_4` FOREIGN KEY (`medida_por_empaque_venta`) REFERENCES `pr_empaque` (`id`),
  CONSTRAINT `pr_productos_ibfk_5` FOREIGN KEY (`id_proveedor`) REFERENCES `co_proveedores` (`id_proveedor`)
) ENGINE=InnoDB AUTO_INCREMENT=2350 DEFAULT CHARSET=utf8;
